/**
*	jQuery waitFor plugin v 1.0.0
*	Licenced under the MIT License	
*	Copyright (c) 2009 
	
*	waitFor allows to call once at specific event approach the set function

*	Basic usage:
		$.waitFor(function() {
				// wait for some value or make some calculation
				if ($('.listItems').length > 1000) { return true; }
				return false;
			}, function() {
				// stop add and alert
				alert('Too much values');
			}
		);
*		$('img.BIGIMAGES').waitFor("load", function(){ alert('All big images loaded'); });
*/ 
(function(jQuery){
	jQuery.extend($, {
		waitFor: function (checkFunction, doFunction, checkIn) {
			var msIntervalValue;
			var timeoutFunction = function() {
				var proceed = false;
				if (typeof checkFunction === 'function') {
					proceed = checkFunction();
				}else{
					proceed = checkFunction; // to be assured -)
				};
				if (proceed) {
					clearInterval(msIntervalValue);
					if (typeof doFunction === 'function') {
						doFunction();
					};
				};
			};
			msIntervalValue = setInterval(timeoutFunction, checkIn || 400); // check in 400ms
		}
	});
  $.extend($.fn, {
	waitFor: function (checkFunction, doFunction, checkIn) {
		if (typeof checkFunction === 'string') {
			var lengthOfThis = $(this).length;
			var timeoutFunction = function() {
				lengthOfThis--;
				if (lengthOfThis <= 0) {
					if (typeof doFunction === 'function') {
						doFunction();
					};
				};
			};
			$(this).bind(checkFunction, timeoutFunction);
		}else{
			$.waitFor(checkFunction, doFunction, checkIn);
		}
		return this;
	}
  });
})(jQuery);


/*
 * JQuery Random Plugin
 * 
 * Adds two random number functions to jQuery -
 * one to find a random number and one to find a random number between a max and min limit.
 * 
 * Usage:$.random(int);  $.random(min, max);
 * 
 * Code found at:
 * http://www.merlyn.demon.co.uk/js-randm.htm
 * 
 */
jQuery.extend({
	rand: function(MinV,MaxV) {
	    if(MaxV==undefined){
	        return Math.floor(MinV * (Math.random() % 1));
	    }else{
	        return MinV + jQuery.rand(MaxV - MinV + 1);  
	    }
	}
});

/**
 * jQuery.rand v1.0
 * 
 * Randomly filters any number of elements from a jQuery set.
 * MIT License: @link http://www.afekenholm.se/license.txt
 * 
 * @author: Alexander Wallin (http://www.afekenholm.se)
 * @version: 1.0
 * @url: http://www.afekenholm.se/jquery-rand
 */
(
function($){
    $.fn.rand = function(k){
        var b = this,n = b.size(), k = k ? parseInt(k) : 1;
         if( n > 0 && ( typeof(b[0]) == 'number' || typeof(b[0]) == 'string' )){
            return b[$.rand(n)];
        }
        else if (k > n) 
		    return b.pushStack(b);
        else if (k == 1) 
		    return b.filter(":eq(" + $.rand(n) + ")");

        // Create a randomized copy of the set of elements,
        // using Fisher-Yates sorting
        r = b.get();
        for (var i = 0; i < n - 1; i++) {
            var swap = $.rand(n-i) + i;
            r[swap] = r.splice(i, 1, r[swap])[0];
        }
        r = r.slice(0, k);

        // Finally, filter jQuery stack
        return b.filter(function(i){
            return $.inArray(b.get(i), r) > -1;
        });
    };
}
)(jQuery);
