;(function($){
    $.sleep_total=0;
	$.sleep = function( _sleeptimer , callback ){
	    if(_sleeptimer<0) _sleeptimer=1;
	    $.sleep_total+=_sleeptimer;
	    _sleeptimer=$.sleep_total;
	    
		var timer = setInterval(function(){
		    --_sleeptimer;
		    
		    if ( _sleeptimer ==0 )
			{
				clearInterval(timer);
				$.sleep_total -=_sleeptimer;
				callback.call(this);
			};
		}, 1000);
	};
	$.sleep.total=0;
	//$.extend ($.sleep, {current_i : 1,_cback : null });
})(jQuery);


